import json
import boto3
import base64
from botocore.exceptions import ClientError
s3 = boto3.client('s3')
s3url = "https://userpicbucket.s3.amazonaws.com/"
def lambda_handler(event, context):
    # TODO implement
    #pic = event['params']['querystring']['userimage']
    #id = event['params']['querystring']['userid']
    pic = event['body-json']['userimage']
    idx = event['body-json']['userid'] + ".png"
    #id = '1'
    #pic = imagebody= ""

    try:
        response = s3.put_object(Bucket='userpicbucket', Key=idx, Body=base64.b64decode(pic))
    except ClientError as e:
        #logging.error(e)
        return {
        'statusCode': 400,
        'body': json.dumps('Error adding picture!')
    }
    
    # adding to dynamo db
    client = boto3.client('dynamodb')
    response = client.put_item(
        TableName = 'userpictable', 
        Item = {
            'idx' : {"S" : idx},
            'userimage' : {"S": s3url+idx}
        }
    )
    
    
    return {
        'statusCode': 200,
        'body': json.dumps('Upload successful')
    }
